import React, {forwardRef} from "react";

import '../Css/ClaseGatos.css';

function ClaseGatos(props, ref){
  return(
    <div className='gato-rpg'>
    <button
      className="bbb"
      onClick={props.agregarTexto}  >
      bajar
    </button>
    <div
    className="aaa"
    ref={ref} >
      {props.textoG}
    </div>
  </div>
  );
};

export default forwardRef(ClaseGatos);
